Whenever an assertion fails, a message will be printed to stderr. The message will look something like this: Assertion Failed at FILE:FUNCTION:LINE for { ACTUAL }: DETAILS The first information is the file where that assertion failed. Then the function name and the line number. Then in place of ACTUAL, a stringified version of the actual parameter, which is the variable being checked in the assertion, will be printed. In DETAILS is where more information about the assertion will be printed. This is the most useful part of these macros. In here, the actual value of the variable will be printed along with the expected value or range or lower bound, etc. In here you will be able to debug your application to check the expected value(s) against the actual one. Example #include "utl/assert.h" void is_one_hundred(int variable)
{ cmc_assert_equals(int32_t, 100, variable);
} int main(void)
{ int my_var = 9; is_one_hundred(my_var);
} This will print the following message: Assertion Failed at main.c:is_one_hundred:5 for { variable }: Expected: 100 Actual: 9

